"use client"
import HostedMeetups from '@/components/HostedMeetups'
import YourMeetups from '@/components/YourMeetups'
import axios from 'axios'
import React, { useEffect, useState } from 'react'
import { ToastContainer, toast,Bounce } from 'react-toastify';
import 'react-toastify/dist/ReactToastify.css';

const page = ({ params }) => {
    const user = localStorage.getItem("user")
    const [issues, setIssues] = useState([]);
    const getIssues = async  () => {
        const response = await fetch(`http://localhost:3000/api/${user}`);
        const data = await response.json();
        
        setIssues(data);    
       
    }
    const deleteIssue = async (id) => {
        const response = await axios.delete(`http://localhost:3000/api/issues/${id}`);
        console.log(response.data)
        if (response.status == 200) {
            toast.success('Issue deleted', {
                position: "top-right",
                autoClose: 5000,
                hideProgressBar: false,
                closeOnClick: true,
                pauseOnHover: true,
                draggable: true,
                progress: undefined,
                theme: "light",
                transition: Bounce,
                });
        }
        getIssues()
        
    
    }



   
    useEffect(() => {
       

        getIssues();
        
        
    }, [])






    
    

    return (
        <>
            <ToastContainer />
            <div className='absolute top-16 border border-black w-[100vw] h-[100vh] bg-white overflow-scroll'>
                <div className="cover-image relative"> <img className='w-[100%] h-[50vh]' src={'Nature-Home.jpeg'} ></img></div>
              

                <div className=' absolute top-[40%] right-[45%] w-[10%] rounded-full overflow-hidden  border border-black '>
                    
                    <img className='' src={ 'data:image/jpeg;base64,'}></img>       
                </div>
                <div className='Your-Info text-center mt-[100px]'>
                    <h1 className='font-bold text-3xl'> Welcome ! {localStorage.getItem("user")}</h1>
                    <span className='m-3 text-gray-500'>• 5 issues </span><span className='m-3 text-gray-500'>• 2 meetups</span>
                </div>
                <div className=' flex w-[100vw]   font-serif mt-10 '>
                    <div className=' border border-gray-500 rounded-lg w-1/2 mx-5 h-[75vh] shadow-md  overflow-scroll '>
                        <h1 className='font-bold text-xl text-center  mt-5'>Issues</h1>
                        

                        {
                            (issues.length ===0 ) && <div className='text-red-500 text-sm text-center' >You haven't Raised any yet ! </div>    
                        }
                       
                       
                        { issues.length!=0  && issues.map((item) => (
                                <div className='m-5 Issue-card border  border-black rounded-lg p-3 '>
                             <h2 className='text-xl font-bold '>Issue</h2>
                            <div className='flex justify-center items-center'>
                            <img className='mx-2 rounded-lg' src={item.image} width={150} alt='imag'></img>
                            <div>
                                <div className='description font-medium'>
                                                { item.description}
                                </div>
                                    <div className='buttons flex justify-end'>
                                                <button className=' mx-2 bg-green-400 rounded-md py-1 px-3 hover:scale-[1.1] transition-all ease-linear  '
                                                onClick={()=>deleteIssue(item._id)}
                                                >Delete</button></div>
                                    </div>
                                </div>

                        </div>

                            )
                            
                        )}
       
                        
                    </div>
                    <div className='border border-black rounded-lg w-1/2 mr-5 h-[75vh] shadow-md '>
                       <HostedMeetups/>

     </div>

                
                </div>
                <div className='border border-black rounded-2xl bg-green-50 shadow-lg m-5 '>
                    <YourMeetups/>
                    
               </div>




                    
           

            </div>
       
        </>
      
  )
}

export default page